import React, { Component } from 'react';

class Home extends Component {
    constructor(props){
        super(props);
        this.user = props.userName;
        this.display = '';
    }
    render() {
        if (this.user == null) {
            return;
        }
        this.display = <h2>Welcome {this.user}</h2>;
        return (
            <div className="App">
                <h1>Project Home</h1>
                {this.display}
            </div>
        )
    }
}

export default Home;
